    CREATE TABLE post
(
	id SERIAL PRIMARY KEY NOT NULL,
	name varchar(100) NOT NULL,
	salary decimal NOT NULL
);

CREATE TABLE IF NOT EXISTS employee
(
	id SERIAL PRIMARY KEY NOT NULL,
	firstname varchar(50) NOT NULL,
	name varchar(50) NOT NULL,
	lastname varchar(50) NULL DEFAULT 'Отчетсво отсутствует',
	birthdate date NOT NULL,
	telephone varchar(50) NOT NULL,
	post_id integer NOT NULL,
	FOREIGN KEY (post_id) REFERENCES post(id)
);

SELECT * FROM post;

SELECT * FROM employee;

CREATE TABLE IF NOT EXISTS passport
(
	id serial PRIMARY KEY NOT NULL,
	serial varchar(10) NOT NULL,
	number varchar(6) NOT NULL,
	who_give varchar(100) NOT NULL,
	when_give date NOT NULL,
	adress varchar(100) NOT NULL,
	FOREIGN KEY (id) REFERENCES employee(id),
	CONSTRAINT unique_nuberserial UNIQUE (number, serial)
);

SELECT * FROM passport;

CREATE TABLE IF NOT EXISTS publisher
(
	id SERIAL PRIMARY KEY NOT NULL,
	name varchar(100) NOT NULL,
	telephone varchar(20) NOT NULL,
	firstname_publisher varchar(50) NOT NULL,
	name_publisher varchar(50) NOT NULL,
	lastname_publisher varchar(50) NULL DEFAULT 'Отчетсво отсутствует',
	legal_adress varchar(100) NOT NULL
);
	
SELECT * FROM publisher;	

ALTER TABLE employee
ALTER COLUMN telephone TYPE varchar(20);

SELECT * FROM employee;

DROP TABLE IF EXISTS book;

CREATE TABLE IF NOT EXISTS book
(
	id serial PRIMARY KEY NOT NULL,
	name varchar(100) NOT NULL,
	date_publication varchar(50) NOT NULL,
	count_pages varchar(50) NOT NULL,
	price decimal NOT NULL,
	count_books integer NOT NULL,
	publisher_id integer NOT NULL,
	FOREIGN KEY (publisher_id) REFERENCES publisher(id)
);

SELECT * FROM book;	

CREATE TABLE IF NOT EXISTS genre
(
	id SERIAL PRIMARY KEY NOT NULL,
	name varchar(50) NOT NULL
);

SELECT * FROM genre;	

CREATE TABLE IF NOT EXISTS book_genre
(
	book_id integer NOT NULL,
	genre_id integer NOT NULL,
	FOREIGN KEY (book_id) REFERENCES book(id),
	FOREIGN KEY (genre_id) REFERENCES genre(id),
	UNIQUE (book_id, genre_id)
);

SELECT * FROM book_genre;

CREATE TABLE IF NOT EXISTS auther
(
	id SERIAL PRIMARY KEY NOT NULL,
	firstname varchar(50) NOT NULL,
	name varchar(50) NOT NULL,
	fastname varchar(50) NULL DEFAULT 'Значение отсутствует',
	birthdate date NOT NULL,
	deathdate date NULL,
	telephone varchar(20) NULL 
);

SELECT * FROM auther;	

CREATE TABLE IF NOT EXISTS book_auther
(
	book_id integer NOT NULL,
	auther_id integer NOT NULL,
	FOREIGN KEY (book_id) REFERENCES book(id),
	FOREIGN KEY (auther_id) REFERENCES auther(id),
	UNIQUE (book_id, auther_id)
);

SELECT * FROM book_auther;

CREATE TABLE IF NOT EXISTS clients
(
	id SERIAL PRIMARY KEY NOT NULL,
	firstname varchar(50) NOT NULL,
	name varchar(50) NOT NULL,
	lastname varchar(50) NULL DEFAULT 'Отчетсво отсутствует',
	Email varchar(50) NOT NULL,
	login varchar(20) NOT NULL,
	password varchar(10) NOT NULL,
	telephone varchar(20) NOT NULL,
	adress varchar(100) NOT NULL
);

SELECT * FROM clients;

CREATE TABLE IF NOT EXISTS orders
(
	id SERIAL PRIMARY KEY NOT NULL,
	date_create date NOT NULL,
	date_finish date NOT NULL,
	status varchar(50) NOT NULL,
	type_deliviry varchar(50) NOT NULL,
	adress_deliviry varchar(100) NULL DEFAULT 'Адресс по умолчанию',
	sum_price decimal NOT NULL,
	clients_id integer NOT NULL,
	employee_id integer NOT NULL,
	FOREIGN KEY (clients_id) REFERENCES clients (id)ON DELETE CASCADE,
	FOREIGN KEY (employee_id) REFERENCES employee (id)ON DELETE CASCADE
);

SELECT * FROM orders;

CREATE TABLE IF NOT EXISTS orders_book
(
	orders_id integer NOT NULL,
	book_id integer NOT NULL,
	FOREIGN KEY (orders_id) REFERENCES orders (id)ON DELETE CASCADE,
	FOREIGN KEY (book_id) REFERENCES book (id)ON DELETE CASCADE,
	UNIQUE (orders_id, book_id)
);

