	WHERE em.lastname IS NULL;
	
CREATE VIEW book_and_auther AS
SELECT book.name AS "Книга",
	auther.firstname AS "Автор"
FROM book_auther
	INNER JOIN book
	ON book_auther.book_id = book.id
	INNER JOIN auther
	ON book_auther.auther_id = auther.id;
	
SELECT * FROM book_and_auther;

